package com.daengdaeng.domain.pet.domain;import javax.persistence.CascadeType;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.FetchType;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;import javax.persistence.JoinColumn;import javax.persistence.OneToOne;import lombok.AccessLevel;import lombok.Getter;import lombok.NoArgsConstructor;@NoArgsConstructor(access = AccessLevel.PROTECTED)@Getter@Entitypublic class MbtiQuestion {	@Id	@GeneratedValue(strategy = GenerationType.IDENTITY)	private int questionId;	@Column(nullable = false, length = 255)	private String question;	@Column(nullable = false, length = 255)	private String answerA;	@Column(nullable = false, length = 255)	private String answerB;	@OneToOne(fetch = FetchType.LAZY, cascade = CascadeType.ALL)	@JoinColumn(name = "type_id")	private MbtiType mbtiType;}